        "publishedAt": "2021-06-01T10:50:17Z",
        "channelId": "UCcN3IuIAR6Fn74FWMQf6lFA",
        "title": "What Exactly is a Tesseract? (Hint: Not a Superhero Stone)",
        "description": "A tesseract is a 4D cube, i.e. a cube that exists in 4 dimensions. Although fans of the Marvel universe and superheroes may associate tesseract with the glowing blue box that houses the Space stone, a tesseract is a real geometrical concept that exists in four dimensions. \n\nHere is a simple way to conceptualize dimensions: a square is a 2D shape, so each of its corners has 2 lines coming off it at 90 degrees to each other. A cube is three-dimensional, so each of its corners has 3 lines coming off it. Similarly, a tesseract is a 4D shape, so every corner has 4 lines coming off it.\nMathematically speaking, a tesseract is a perfectly accurate and plausible shape, as are all shapes in higher dimensions, such as 5D and 6D. Just as a cube can be unfolded into 6 squares in 2D space, a tesseract can be unfolded into 8 cubes in 3D space.\n\n\n#science #animation #tesseract\n\n\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
